HTMLTableElement.prototype.jsonify=function(){if(this.rows<1){return{error:'There are no rows in the table.'}}const H=[...this.rows[0].cells].map(c=>c.innerText);if(H.length > new Set(H).size){return{error:`Headers repeat.`}}const R=[...this.rows].map((r,i)=>{if(i==0){return;}const C=[...r.cells].map(c=>c.innerText);return H.reduce((A,P,I)=>(A={...A,[P.valueOf()]:C[I] }),{})});R.shift();return{error:!1,res:R,headers:H}};if(!window){module.exports=jsonify}